import React, {useState, Fragment} from "react";

function App() {

  return (
    <Fragment>
      <nav class="navbar navbar-light bg-light">
  <div class="container-fluid">
    dsadas
  </div>
</nav>
      <div className="row">
        {services.map(service => (
          <Service service={service} key={service.id}/>
        ))}

      </div>

    </Fragment>
  );
}

export default App;
